nx.initSEQ = function(config){//if we found the epic init, run, end-.
    // if(config && config.seqID && nx.SEQZ[config.seqID] && nx.SEQZ[config.seqID].seqID===config.seqID){ 
    if(config && config.seqID && nx.SEQZ[config.seqID]){ 
        nx.SEQZ[config.seqID].initfn();
        // nx.masterIDX = config.seqID; //The only place master sequence idx is set-.
        nx.activeSEQ = nx.SEQZ[config.seqID]; //The only place where current EPIC is set into Sequence-.
    }
}

nx.runSEQ = function(config){ //if we found the epic init, run, end-.
    // debugger;
    // if(config && config.seqID && nx.SEQZ[config.seqID] && nx.SEQZ[config.seqID].seqID===config.seqID){ 
    if(config && config.seqID && nx.SEQZ[config.seqID]){ 
        nx.SEQZ[config.seqID].runfn();
    }
}

nx.endSEQ = function(config){ //if we found the epic init, run, end-.
    // if(config && config.seqID && nx.SEQZ[config.seqID] && nx.SEQZ[config.seqID].seqID===config.seqID){ 
    if(config && config.seqID && nx.SEQZ[config.seqID]){ 
        if(nx.SEQZ[config.seqID].endfn){ nx.SEQZ[config.seqID].endfn(); }
        // nx.masterIDX++; //The only place to iterate master sequence is after last sequence endfn-.
    }
}

